import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

const CoursePage = () => {
    const course = { course_id: 1, course_name: 'Курс 1', course_duration: 180, course_price: 35000 }
    const module = [
        { module_id: 1, module_name: 'Модуль 1' },
        { module_id: 2, module_name: 'Модуль 2' }
    ]
    return (
        <Container>
            <Row>
                <Col md={2}>type</Col>
            </Row>
            <Row>
                <Col md={12}>{course.course_name}</Col>
            </Row>
            <Row>
                <Col md={2}>btn</Col>
                <Col md={2}>close date</Col>
            </Row>
            <Row>
                <Col md={3}>format</Col>
                <Col md={3}>{course.course_price} рублей</Col>
                <Col md={3}>{course.course_duration} часов</Col>
                <Col md={3}>shedule</Col>
            </Row>
            <Row>
                {module.map(info =>
                    <Row key={info.module_id}>
                        info: module_name
                    </Row>
                )}
            </Row>
        </Container>
    );
};

export default CoursePage;
